      Dance_Party_extras_intro:
        markdown: "# Bliv ved med at danse!\n\nI del 2, skal du skabe dit eget projekt.
          Her er der ingen opgaver - i stedet er der en masse projekter, som viser
          forskellige måder, du kan kode mere sammensatte danse.\n\nDu kan prøve disse
          levels _i tilfældig rækkefølge_. Hop rundt og kig hvordan tingene er gjort
          på et tidligere level, eller kombiner idéerne fra de forskellige projekter.
          Prøv dem alle og vælg din favorit. Brug tiden på at skabe og tilføj til
          det projekt du har valgt, og gør det til dit eget projekt. \n\n<a class=\"btn
          btn-large btn-primary next-stage submitButton pull-right\">Continue</a>\n\n<div
          class=\"clearfix\"></div>\n\n<div style=\"float: left; margin: 10px\">\n<a
          href=\"2\">\n<h2>\nGet in Formation\n</h2>\n\n<img src=\"https://images.code.org/70ad4cbc12321f301d43161f847bdee4-image-1541746835274.gif\"></a>\n\n</div>\n\n<div
          style=\"float: left; margin: 10px\">\n<a href=\"3\">\n<h2>\nWhere'd They
          Go?\n</h2>\n\n<img src=\"https://images.code.org/524010de61c9af76e98bd2a5ccdba461-image-1541746855689.gif\"></a>\n\n</div>\n\n<div
          style=\"float: left; margin: 10px\">\n<a href=\"4\">\n<h2>\nDance Crews\n</h2>\n\n<img
          src=\"https://images.code.org/f4ccfd43f9a15d68a339b449be8e96c3-image-1541746870889.gif\"></a>\n\n</div>\n\n<div
