        markdown: "# Fortsæt med at danse!\n\nI del 2, skal du skabe dit eget projekt.
          Her er der ingen opgaver - i stedet er der en masse projekter, som viser
          forskellige måder, du kan kode mere sammensatte danse.\n\nDu kan prøve disse
          levels _i tilfældig rækkefølge_. Hop rundt og kig hvordan tingene er gjort
          på et tidligere level, eller kombiner idéerne fra de forskellige projekter.
          Prøv dem alle og vælg din favorit. Brug tiden på at skabe og tilføj til
          det projekt du har valgt, og gør det til dit eget projekt. \n\n<a class=\"btn
